import "./App.css";
import logoSvg from "../src/images/svg/header_logo.svg";

function App() {
  return (
    <div className="wrap">
      <header>
        <div className="header__logo">
          <img href={logoSvg} className="header__logo_svg"></img>
        </div>
        <div className="header__shop"></div>
      </header>
    </div>
  );
}

export default App;
